import * as axs from './axs'; 


export const headSearchAction = (searchData, setLoading) => async (dispatch) =>{
    try{
        const{data}= await axs.saveDiariesApi(savedDiaryData);
        if(data.message === 'Success'){
            console.log(data);
            dispatch({type: 'HEAD_SEARCH', payload: data});
            setLoading(false);

        } else if (data.message === 'NoTerm'){
            setLoading(false);
            setReply('NoTerm');
        }


    } catch(error){
        console.log(error);
    }
}
